webpackJsonp([73333010742434],{6885:function(e,t){e.exports={data:{post:{html:'<p>We can forget any suspense at the Euro 2004, since Anna has <a href="http://www.jinglelady.us/blog/archives/000617.html" title="Adventures of an American Girl in Germany: My picks for the final Euro2004 games">published her favorites for the final games</a>, and her favorites have without fail all lost. The prospect of Holland as champion is horrifying for German fans (according to Duden, <em>Schadenfreude</em> is defined as "disappointed Dutch fans; see <a href="http://www.papascott.de/archives/2002/06/12/world-cup-how-german-soccer-fans-feel/">World Cup 2002</a>"), but one we have to accept.</p>',fields:{title:"It's Over",date:"30 Jun 2004",url:"https://papascott.de/2004-06-30-its-over/"}}},pathContext:{slug:"/2004-06-30-its-over/",prev:{fields:{title:"Pulling out of here to win",date:"29 Jun 2004",slug:"/2004-06-29-pulling-out-of-here-to-win/"}},next:{fields:{title:"Can't Happen Here",date:"01 Jul 2004",slug:"/2004-07-01-cant-happen-here/"}}}}}});
